import React from "react";
import "./Navigation.css";

const Navigation = () => {
	return (
		<nav>
			<p
				className="f3 link dim black underline pa3 pointer"
				style={{ display: "flex", justifyContent: "flex-end" }}
			>
				Sign Out
			</p>
			<p className="title white">{"smart brain"}</p>
		</nav>
	);
};

export default Navigation;
